import React, { useState } from "react";
import { Draggable } from "@hello-pangea/dnd";
import { FaEdit, FaTrash } from "react-icons/fa"; // Ícones de edição e exclusão
import Modal from "react-modal"; // Importa React Modal

const customStyles = {
  content: {
    top: "50%",
    left: "50%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
    padding: "20px",
    borderRadius: "10px",
    backgroundColor: "#fff",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
  },
};

Modal.setAppElement("#root"); // Necessário para acessibilidade

const Tarefa = ({ tarefa, index, onEdit, onDelete }) => {
  const [modalIsOpen, setModalIsOpen] = useState(false); // Estado do modal
  const custoNumerico = Number(tarefa.custo); // Converte custo para número

  const estiloDestaque =
    custoNumerico >= 1000
      ? { backgroundColor: "#fff9c4", fontWeight: "bold" }
      : { backgroundColor: "#f0f0f0" };

  const openModal = () => setModalIsOpen(true);
  const closeModal = () => setModalIsOpen(false);

  const confirmDelete = () => {
    onDelete(); // Executa a função de exclusão
    closeModal(); // Fecha o modal
  };

  return (
    <Draggable draggableId={tarefa.id.toString()} index={index}>
      {(provided) => (
        <div
          {...provided.draggableProps}
          {...provided.dragHandleProps}
          ref={provided.innerRef}
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "space-between",
            margin: "8px 0",
            padding: "16px",
            borderRadius: "4px",
            ...estiloDestaque,
            ...provided.draggableProps.style,
          }}
        >
          <div>
            <h3>{tarefa.nome}</h3>
            <p>
              <strong>ID:</strong> {tarefa.id}
            </p>
            <p>Custo: R$ {custoNumerico.toFixed(2)}</p>
            <p>Data Limite: {tarefa.dataLimite}</p>
          </div>
          <div style={{ display: "flex", gap: "8px" }}>
            <button
              onClick={onEdit}
              style={{
                border: "none",
                background: "transparent",
                cursor: "pointer",
              }}
            >
              <FaEdit size={20} color="#4CAF50" title="Editar" />
            </button>
            <button
              onClick={openModal}
              style={{
                border: "none",
                background: "transparent",
                cursor: "pointer",
              }}
            >
              <FaTrash size={20} color="#f44336" title="Excluir" />
            </button>
          </div>

          {/* Modal de Confirmação */}
          <Modal
            isOpen={modalIsOpen}
            onRequestClose={closeModal}
            style={customStyles}
            contentLabel="Confirmação de Exclusão"
          >
            <h2 style={{ color: "#333" }}>Confirmação</h2>
            <p>Tem certeza que deseja excluir a tarefa "{tarefa.nome}"?</p>
            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                marginTop: "20px",
              }}
            >
              <button
                onClick={confirmDelete}
                style={{
                  padding: "10px 20px",
                  backgroundColor: "#f44336",
                  color: "#fff",
                  border: "none",
                  borderRadius: "5px",
                  cursor: "pointer",
                }}
              >
                Sim, excluir
              </button>
              <button
                onClick={closeModal}
                style={{
                  padding: "10px 20px",
                  backgroundColor: "#ccc",
                  color: "#333",
                  border: "none",
                  borderRadius: "5px",
                  cursor: "pointer",
                }}
              >
                Cancelar
              </button>
            </div>
          </Modal>
        </div>
      )}
    </Draggable>
  );
};

export default Tarefa;
